import React, { useEffect, useState } from "react";

export default function Moder() {
    const [announcements, setAnnouncements] = useState([]);

    console.log(announcements);

    useEffect(() => {
        // Tokenni cookie dan olib olamiz
        const token = getCookie("token");

        const url = new URL("https://api.frossh.uz/api/announcement/get-by-moderation");
        const headers = {
            "Authorization": `Bearer ${token}`, // Tokenni Authorization headerga qo'shamiz
            "Content-Type": "application/json",
            "Accept": "application/json",
        };

        fetch(url, {
            method: "GET",
            headers,
        })
        .then(response => response.json())
        .then(data => {
            setAnnouncements(data); // Ma'lumotlarni React state ga saqlash
        })
        .catch(error => {
            console.error('Error fetching data:', error);
        });
    }, []); // useEffect faqat bir martta ishga tushadi, bo'sh massiv yuborilgan

    // Cookie dan tokenni olib beradigan funktsiya
    const getCookie = (name) => {
        const value = `; ${document.cookie}`;
        const parts = value.split(`; ${name}=`);
        if (parts.length === 2) return parts.pop().split(';').shift();
    };

    return (
        <div>

        </div>
    );
}
